import React from "react";

const Service = () => {
  return (
    <div className="services">
      <div className="container">
        <div className="success-header">
          <h2>3 boxes every successful website needs to cheek</h2>
          <p>
            There are millions of websites but not every website is successful.
            I have focused on and mastered the right things that make a website
            successful.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Service;
